import React from 'react';
import { Switch, Route, Redirect } from 'react-router-dom';


import InicioScreen from '../Inicio/InicioScreen';
import PersonalScreen from '../Personal/PersonalScreen';
import TiendasScreen from '../Tiendas/TiendasScreen';

export const DashboardRoutes = () => {
    return (
        <>
            <div className="m-2">
                <CustomNavbar />
            </div>
            {/* <Navbar /> */}

            <div className="container-fluid mt-2">
                <Switch>
                    <Route exact path="/inicio" component={ InicioScreen } />
                    <Route exact path="/tiendas" component={ TiendasScreen } />
                    <Route exact path="/personal" component={ PersonalScreen } />

                    <Redirect to="/hospitales" />
                </Switch>
            </div> 


        </>
    )
}
